import PieChart from "./PieChart";
import LineChart from "./LineChart";

function Charts() {
  return <>

  <LineChart></LineChart>

  <div style={{display:"flex",flexDirection:"row"}}>
    <div><ColumnChart></ColumnChart></div>
    <div>
    <PieChart></PieChart>


    </div>
  </div>
  </>
}

export default Charts;
